This code block is very difficult to read, and the logic can be cleaned up considerably by avoiding find.  Loop over the inputs once, track the various states as needed, then once done looping do something like

if (hasManagerConsole ^ hasHostConsole){
   // set error
}

FWIW, I really dislike this limitation in the SSH subsystem, and it seems non-obvious to clients to be requiring it in Redfish.  Is there a way we can just make this work the way one would expect, where host console privileges are independent of bmc console?
